import React from 'react';
import {
  Card,
  CardContent,
  Typography,
  Grid,
  Avatar,
  Box,
  Divider,
} from '@mui/material';

// Mapping of rune styles and perks to their respective names
const RUNE_STYLE_NAMES = {
  8100: 'Domination',
  8300: 'Inspiration',
  8000: 'Precision',
  8400: 'Resolve',
  8200: 'Sorcery',
};

const RUNE_PERK_NAMES = {
  8112: 'Electrocute',
  8124: 'Predator',
  8128: 'DarkHarvest',
  9923: 'HailOfBlades',
  8351: 'GlacialAugment',
  8360: 'UnsealedSpellbook',
  8005: 'PressTheAttack',
  8008: 'LethalTempo',
  8021: 'FleetFootwork',
  8010: 'Conqueror',
  8437: 'GraspOfTheUndying',
  8439: 'Aftershock',
  8465: 'Guardian',
  8214: 'SummonAery',
  8229: 'ArcaneComet',
  8230: 'PhaseRush',
};

function Match({ match }) {
  if (!match) return null;

  const {
    champion,
    win,
    items = [],
    kills,
    deaths,
    assists,
    gameDuration,
    summonerSpells = [],
    runes = [],
    participants = [],
    version = "14.21.1",
  } = match;

  const matchOutcome = win ? 'Victory' : 'Defeat';
  const outcomeColor = win ? 'success.main' : 'error.main';
  const matchBgColor = win ? '#e8f5e9' : '#ffebee'; // Light green for win, light red for loss

  // Prepare champion image
  const championImage = (
    <Avatar
      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${champion}.png`}
      alt={champion}
      sx={{ width: 64, height: 64 }}
    />
  );

  // Prepare item images
  const itemImages = items
    .filter((itemId) => itemId > 0)
    .map((itemId, index) => (
      <Avatar
        key={`item-${itemId}-${index}`}
        src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/item/${itemId}.png`}
        alt={`Item ${itemId}`}
        sx={{ width: 30, height: 30, mr: 0.5 }}
        variant="rounded"
      />
    ));

  // Prepare summoner spell images
  const spellImages = summonerSpells.map((spellName, index) => (
    <Avatar
      key={`spell-${spellName}-${index}`}
      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/spell/${spellName}.png`}
      alt={`Spell ${spellName}`}
      sx={{ width: 30, height: 30, mr: 0.5 }}
      variant="rounded"
    />
  ));

  // Prepare rune images
  const runeImages = runes.map((runeStyle, index) => {
    const styleName = RUNE_STYLE_NAMES[runeStyle.style] || 'Unknown';
    const perkName = RUNE_PERK_NAMES[runeStyle.selections[0]?.perk] || 'Unknown';

    return (
      <Avatar
        key={`rune-${index}`}
        src={`https://ddragon.leagueoflegends.com/cdn/img/perk-images/Styles/${styleName}/${perkName}/${perkName}.png`}
        alt={`Rune ${styleName}`}
        sx={{ width: 30, height: 30, mr: 0.5 }}
        variant="rounded"
      />
    );
  });

  // Prepare team details
  const team1Details = participants.slice(0, 5).map((participant, index) => (
    <Box key={`team1-participant-${index}`} display="flex" alignItems="center" mb={0.5}>
      <Avatar
        src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${participant.championName}.png`}
        alt={participant.championName}
        sx={{ width: 25, height: 25, mr: 1 }}
      />
      <Typography variant="body2">{participant.summonerName}</Typography>
    </Box>
  ));

  const team2Details = participants.slice(5, 10).map((participant, index) => (
    <Box key={`team2-participant-${index}`} display="flex" alignItems="center" mb={0.5}>
      <Avatar
        src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${participant.championName}.png`}
        alt={participant.championName}
        sx={{ width: 25, height: 25, mr: 1 }}
      />
      <Typography variant="body2">{participant.summonerName}</Typography>
    </Box>
  ));

  return (
    <Card variant="outlined" sx={{ mb: 2, backgroundColor: matchBgColor, boxShadow: 3 }}>
      <CardContent>
        <Grid container spacing={2}>
          {/* Left Side: Player's Match Info */}
          <Grid item xs={12} md={8}>
            <Box display="flex" alignItems="center">
              {championImage}
              <Box ml={2}>
                <Typography variant="h6" color={outcomeColor}>
                  {matchOutcome}
                </Typography>
                <Typography variant="body1">
                  {kills}/{deaths}/{assists} K/D/A
                </Typography>
                <Typography variant="body2">Duration: {gameDuration}</Typography>
              </Box>
            </Box>

            <Box mt={2}>
              <Typography variant="subtitle1" gutterBottom>
                Summoner Spells:
              </Typography>
              <Box display="flex">
                {spellImages}
              </Box>
            </Box>

            <Box mt={2}>
              <Typography variant="subtitle1" gutterBottom>
                Runes:
              </Typography>
              <Box display="flex">
                {runeImages}
              </Box>
            </Box>

            <Box mt={2}>
              <Typography variant="subtitle1" gutterBottom>
                Items:
              </Typography>
              <Box display="flex">
                {itemImages}
              </Box>
            </Box>
          </Grid>

          {/* Right Side: Match Participants - Split into Two Teams */}
          <Grid item xs={12} md={4}>
            <Grid container>
              <Grid item xs={6}>
                <Typography variant="subtitle1" gutterBottom>
                  Team 1:
                </Typography>
                {team1Details}
              </Grid>
              <Grid item xs={6}>
                <Typography variant="subtitle1" gutterBottom>
                  Team 2:
                </Typography>
                {team2Details}
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
}

export default Match;
